import React from "react";
import "./about.css";

const About = () => {
  return (
    <div className="about section__margin" id="about">
      <div className="about-heading">
        <h1>Hi I'm Debo!</h1>
        <p>
          It's a pleasure to meet you. My name is Debo. I'm a software
          engineering student at the Schulich School of Engineering, with a
          passion for frontend development, UI/UX design and app development.
          Currently familiar with front end languages such as HTML, CSS,
          JavaScript, React, etc. as well as back end languages such as Python,
          and many frameworks such as Bootstrap and Express.js.
        </p>
      </div>
      <div className="about-container"></div>
    </div>
  );
};

export default About;
